    text-align: center;
    background: ${colors.secondary}1A;
    color: ${colors.darkBrown};
    padding: 20px 0;
`

const index = () => {
    return (
        <FooterContainer>
            <Section>Made with love by wedwizards❤️</Section>
        </FooterContainer>
    )
}

export default index
